const Header = ({showFullSchedule, setShowFullSchedule}) => {

    return (
        <header>
            <h1>
                Zoom Meeting Manager
            </h1>
            <button onClick={setShowFullSchedule} 
            text={showFullSchedule ? "Create Meeting" : "Full Schedule"}/>
        </header>
    )
}
export default Header
